        function updateMap(day, branch, type) {
            markers.forEach(marker => map.removeLayer(marker));
            markers = [];
            
            carData.forEach(car => {
                if ((day === 'all' || car.day == day) && 
                    (branch === 'all' || car.branch == branch) &&
                    (type === 'all' || car.type == type)) {
                    var marker = L.circleMarker([car.lat, car.lon], {
                        color: branchColors[car.branch],
                        radius: 6,
                        fillOpacity: 0.8
                    }).bindPopup("מספר רכב: " + car.car + "<br>סוג רכב: " + car.type + "<br>סניף: " + car.branch);

                    markers.push(marker);
                }
            });
